/**
 * Verifica si un código postal tiene cobertura para "Paga al Recibir"
 * @param {string|number} codigoPostal - El código postal a verificar (5 dígitos)
 * @returns {boolean} - true si tiene cobertura, false si no
 */
function verificarCoberturaPagoAlRecibir(codigoPostal) {
  const cpLimpio = codigoPostal.toString().trim();
  
  // Verificar formato: exactamente 5 dígitos
  if (!/^\d{5}$/.test(cpLimpio)) {
    return false;
  }
  
  // Buscar en el Set
  return CODIGOS_POSTALES_RECAUDO.has(cpLimpio);
}

// Exportar función global
window.verificarCoberturaPagoAlRecibir = verificarCoberturaPagoAlRecibir;

// Log de verificación
if (typeof console !== 'undefined') {
  console.log(' Verificador "Paga al Recibir" cargado con ' + CODIGOS_POSTALES_RECAUDO.size + ' códigos');
}
